DROP TABLE IF EXISTS joga;

CREATE TABLE joga (
  fk_Jogo_Titulo VARCHAR(45) NOT NULL,  -- Usando NOT NULL para chaves estrangeiras
  fk_Jogador_JogadorID INT NOT NULL,    -- Usando NOT NULL para chaves estrangeiras
  PRIMARY KEY (fk_Jogo_Titulo, fk_Jogador_JogadorID),
  CONSTRAINT FK_Joga_Jogo FOREIGN KEY (fk_Jogo_Titulo) REFERENCES Jogo (Titulo),
  CONSTRAINT FK_Joga_Jogador FOREIGN KEY (fk_Jogador_JogadorID) REFERENCES Jogador (JogadorID)
);


